import React from 'react';
import './InputBox.css';

const InputBox = (props) => {
  return(
    <div className='input-box'>
      <label htmlFor={props.name}>{props.text}</label>
      <input type={props.type} name={props.name} id={props.name} required={true} value={props.value} onChange={() => props.handleChange(props.name) }></input>
    </div>
  )
}

export default InputBox;
